import styled from 'styled-components'

export const FlexboxCenter = styled.div`
display: flex;
justify-content: center;
align-items: center;
`;

export const FlexboxRowCenter = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
`;
